import React from 'react'
import styled from 'styled-components'

let Flex = styled.div`

    display: flex;
        justify-content:center;
        align-items:center;

`
let Title = styled.h1`
    margin-top: 5rem;
    font-size: 3rem;
    color: #fff;

`

let Lbl = styled.label`
        color: #fff;

`

export default function Register() {
  return (
    <Flex>
        <Title>Register</Title>
        <form >
            <div>
                <Lbl htmlFor='register'></Lbl>
                <input type='text'/>
            </div>
        </form>

    </Flex>
  )
}
